const queryClient = new QueryClient();
function App() {
  return(
    <QueryClientProvider client={queryClient}>
    <Router>
    <HeaderSearchComponent />
      <Routes>
        {routes.map((route)=>{
          const Page = route.page
          return(
            <Route path={route.path} element = {<Page/>}/>
          )
        })}
      </Routes>
    </Router>
    </QueryClientProvider>
  )
}

export default App;
